import React from 'react';
import s from './css/Choise.module.css'


const Choise = () => {
  return (
    <div className={s.toggle}>
      <input type="radio" id="radio1" name="radios" value="all" checked></input>
      <label for="radio1">Фіз. особа</label>
      <input type="radio" id="radio2" name="radios" value="false"></input>
      <label for="radio2">Юр. особа</label>
    </div>
  );

}
export default Choise;
